import React, { useEffect, useState } from "react";
import axios from "axios";

const App = () => {
  const [users, setUsers] = useState([]);
  const [comments, setComments] = useState([]);
  const [canteenMenu, setCanteenMenu] = useState([]);
  const [events, setEvents] = useState([]);
  const [meetings, setMeetings] = useState([]);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchData = async () => {
      try {
        console.log("Fetching users...");
        const userResponse = await axios.get("/api/users");
        console.log("User response data:", userResponse.data);
        setUsers(userResponse.data);

        console.log("Fetching comments...");
        const commentResponse = await axios.get("/api/comments");
        console.log("Comment response data:", commentResponse.data);
        setComments(commentResponse.data);

        console.log("Fetching canteen menu...");
        const canteenMenuResponse = await axios.get("/api/canteen-menu");
        console.log("Canteen menu response data:", canteenMenuResponse.data);
        setCanteenMenu(canteenMenuResponse.data);

        console.log("Fetching events...");
        const eventResponse = await axios.get("/api/events");
        console.log("Event response data:", eventResponse.data);
        setEvents(eventResponse.data);

        console.log("Fetching meetings...");
        const meetingResponse = await axios.get("/api/meetings");
        console.log("Meeting response data:", meetingResponse.data);
        setMeetings(meetingResponse.data);
      } catch (error) {
        console.error("Error fetching data:", error);
        setError(error);
      }
    };

    fetchData(); // Call the async function to fetch data
  }, []);

  // Error handling and rendering your UI with the fetched data ...
  return (
    <div>
      <h1>Data from API</h1>
      {error && <p>Error fetching data: {error.message}</p>}
      <h2>Users</h2>
      <ul>
        {users.map((user) => (
          <li key={user.id}>{user.name}</li>
        ))}
      </ul>
      <h2>Comments</h2>
      <ul>
        {comments.map((comment) => (
          <li key={comment.id}>{comment.text}</li>
        ))}
      </ul>
      <h2>Canteen Menu</h2>
      <ul>
        {canteenMenu.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul>
      <h2>Events</h2>
      <ul>
        {events.map((event) => (
          <li key={event.id}>{event.name}</li>
        ))}
      </ul>
      <h2>Meetings</h2>
      <ul>
        {meetings.map((meeting) => (
          <li key={meeting.id}>{meeting.title}</li>
        ))}
      </ul>
    </div>
  );
};

export default App;
